import React from "react";
import Typed from "react-typed";


const Home = () => {
    return(
        <React.Fragment>
            <div className = "header-wraper">
                <div className = "main-info">
                    <h1>Web Development And Web Promotion</h1>
                    <Typed className = "typed-text"
                    strings = {["Web Designer" , "Web Developer" , "Graphics Designer" , "Virtual Assistant" , "Frontend Development Trainer" , "Adds Social Media Marketing" , "Content Writer"]}
                    typeSpeed = {40}
                    backSpeed = {60} />
                    <a href = "#">Contact Me</a>
                </div>
            </div>
        </React.Fragment>
    );
}

export default Home;
